import { PURPLE_GRADIENT } from "./theme";

export const GCUBottomBar = () => {
  return (
    <div
      style={{
        position: "fixed",
        top: "auto",
        bottom: 0,
        left: 0,
        width: "100vw",
        height: "56px",
        background: PURPLE_GRADIENT,
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          fontWeight: "bold",
          fontSize: "1.2rem",
        }}
      >
        Student ID
      </div>
    </div>
  );
};
